import { Link } from "react-router-dom";

function MenuItem({ image, name, price }) {
  return (
    <div className="menuItem">
      <div style={{ backgroundImage: `url(${image})` }}> </div>
      <h1> {name} </h1>
      <p> {price} </p>
      <button>
      <div><Link to="/menu"><button>Suscribete</button></Link>
      </div>
      </button>
    </div>
  );
}

export default MenuItem;
